import { useState, useEffect } from "react";
// import { Data } from "./emogiJson";

export const Main = () => {
  const url = " https://emoji.ymatuhin.workers.dev/";
  const [Data, setData] = useState([]);
  const [Value, setValue] = useState(Data);

  function handlChange(event) {
    const a = setData(event.target.value);
    return a;
  }

  //   let displayInput = () => (
  //     <input type= "text" onChange={handlChange} />
  //   );
  //   const Data = (event) => event.target.value;
  const getData = async () => {
    let response = await fetch(url);
    let makeJson = await response.json();
    setData(makeJson);
  };
  useEffect(() => {
    // displayInput();
    getData();
  }, []);
  function displayData () {
    return Data.map((elem) => ( <div>
        <div>{elem.title}</div>
        <div>{elem.symbol}</div>
        <div>{elem.keywords}</div>
      </div>
    ));
  }

  return (
    <>
      <input type="text" onChange={(event) => setValue(event.target.value)} />

      <div>{displayData}</div>
    </>
  );
};
